import React, { Component } from 'react'

export default class Form extends Component {
    
    constructor(props){
        super(props);
        this.state={
            input:'test',
            input2:'test2'
        }
        
        this.handleChange=this.handleChange.bind(this)

    }
    handleChange(key){
       return (e)=>{
            const value=e.target.value;
            this.setState({[key]:value})
       }
    }
  
    handleSubmit(e){
        e.preventDefault()
        
        
    }
    render() {
        return (
            <div>
               <form onSubmit={this.handleSubmit.bind(this)} >
               <input onChange={this.handleChange('input')} value={this.state.input} type="text" placeholder="input" />
               <input onChange={this.handleChange("input2")} value={this.state.input2} type="text" placeholder="input" />
                <button type="submit" >ok</button>
               </form>
            </div>
        )
    }
}
